import React, { Component } from "react";
import NewItem from "./NewItem";

export default class News extends Component {
  render() {
    return (
      <div className="container my-2">
        <h2>NewsMonkey Top Headlines</h2>
        <div className="row">
          <div className="col-md-4">
            <NewItem title="myTitle" description="mydesc" imageUrl="https://i.guim.co.uk/img/media/ed6d459e53ecd12dcbace7ce66e9616125a2a17d/0_139_4890_2934/master/4890.jpg?width=1200&height=630&quality=85&auto=format&fit=crop&overlay-align=bottom%2Cleft&overlay-width=100p&overlay-base64=L2ltZy9zdGF0aWMvb3ZlcmxheXMvdGctbGl2ZS5wbmc&enable=upscale&s=1c618612e180434517166d635fc3f845 " />
            <NewItem title="myTitle" description="mydesc" />
          </div>
          <div className="col-md-3">
            <NewItem title="myTitle" description="mydesc" imageUrl="https://i.guim.co.uk/img/media/ed6d459e53ecd12dcbace7ce66e9616125a2a17d/0_139_4890_2934/master/4890.jpg?width=1200&height=630&quality=85&auto=format&fit=crop&overlay-align=bottom%2Cleft&overlay-width=100p&overlay-base64=L2ltZy9zdGF0aWMvb3ZlcmxheXMvdGctbGl2ZS5wbmc&enable=upscale&s=1c618612e180434517166d635fc3f845 " />
          </div>
          
        </div>
      </div>
    );
  }
}
